import React, { useEffect, useState } from "react";
import axios from "axios";
import Slider from "react-slick";
import img1 from "../../assets/images/homepage/fashionshoes.jpg";
import img8 from "../../assets/images/homepage/hero-sec-bg-2.webp";
const Homepage2 = () => {
  const [Homepage1Data, setData] = useState([]);
  useEffect(() => {
    axios
      .get("https://admin.lining.com.np/api/home")
      .then((response) => {
        console.log("res", response);
        setData(response.data.items);
      })
      .catch((e) => {
        console.log("e", e);
      });
  }, []);
  let settings = {
    dots: true,
    nav: true,
    infinite: true,
    speed: 500,
    slidesToShow: 4,
    slidesToScroll: 1,
  };
  return (
    <>
      <section className="main-carousel">
        <div className="container">
          <h3>Best of Li-Ning</h3>
          <Slider {...settings}>
            <div>
              <div className="card">
                <img src={img1} className="card-img-top" alt="..." />
                <div className="card-body">
                  <div className="d-flex justify-content-between">
                    <h6>Li-Ning Shoes</h6>
                    <h6>Rs 5,000</h6>
                  </div>
                  <p>Men's Shoes</p>
                </div>
              </div>
            </div>
          </Slider>
        </div>
      </section>

      <section className="hero-section-2">
        <div className="container">
          <img src={img8} alt="" />
        </div>
      </section>
    </>
  );
};
export default Homepage2;
